●最高1.2気圧の圧力、105℃の高温で炊飯する圧力IH炊飯ジャーの5.5合炊きです。<BR>●極上炊き機能では、「しゃっきり」「もちもち」と「かため」「ふつう」「やわらかめ」を組み合わせた計6通りの炊き上がりをお好みで選択することができます。<BR>●外に出る蒸気を抑える蒸気セーブタイプです。<BR>●IH発熱効率が高い鉄を採用し、大火力を引き出せる黒厚鉄釜カーボンフッ素加工の内釜を採用しています。<BR>●設定した時間で、保温を自動で切ることができます。<BR>●予約炊飯を2メモリー搭載しているので、2通りの炊きあがり時間を設定できます。<br>●加熱方式／圧力IHタイプ<BR>●炊飯容量／5.5合<BR>●色／ライトブラウン<BR>●内なべ／黒厚鉄釜<BR>●最大炊飯容量区分／B<BR>●電源／交流100V 50/60Hz<BR>●電源ケーブル長さ／1m<BR>●消費電力／1400W<BR>●寸法／W25.8×D36.4×H22.7cm<BR>●ふたを開いたときの高さ／41.8cm<BR>●釜の厚さ／2.3mm<BR>●質量／約5.3kg<BR>●付属品／しゃもじ、しゃもじ受け、計量カップ×2（白米用：約180ml/約1合、無洗米用：約170ml/約1合）<BR>●保証期間／本体：1年、内がま内面フッ素被膜：6年<br>●メーカー／日立<br>●型番／RZ-WG10M-T<br>●JANコード／4902530108521<br><br>※メーカー都合によりパッケージ・仕様等が予告なく変更される場合がございます。ご了承ください。<br><br>本商品は自社サイトでも販売しているため、ご注文のタイミングにより、発送までにお時間をいただいたり、やむをえずキャンセルさせていただく場合がございます。<br><br>※沖縄へのお届けは別途1620円(税込)の送料がかかります。<p>お買い物マラソン等イベント開催中は、ご注文の集中により発送手続き、お問い合わせの回答にお時間をいただく場合がございます。ご了承ください。</p>

