●圧力の強さと圧力をかける時間を調整することで、すしめし、白米しゃっきりからもちもちまでメニューにあわせて4通りの食感に炊き分けます。好みの食感に合わせて炊いていただけます。<BR>●釜の内側はプラチナ（白金）ナノ粒子（プラチナを10億分の2メートルの粒状に加工してほぼ均一な超微粒子のこと）の触媒効果で、米の表面にあるたんぱく質を分解し、水が芯まで浸透しやすくなります。ごはんの甘み成分の一つである還元糖量がアップします。<BR>●「うるつや保温」で、釜内の温度を最適にコントロールし、30時間おいしく保温できます。また、あたたかいごはんを食べたい方におすすめの「高め保温」メニューがあります。<BR>●熟成炊きは時間をかけ水に浸し、芯までじっくり吸水させます。芯まで行き渡った水は、お米の芯からアルファ化を促進し、ふっくらおいしくなります。<BR>●ミネラルや食物繊維がたっぷり入った雑穀米や玄米が炊けます。<BR>●電力量を抑えながら炊き、蒸気量を抑えることができます。<br>●加熱方式／電磁誘導加熱方式（IH）<BR>●炊飯容量／0.5～3合<BR>●色／ダークブラウン<BR>●内なべ／プラチナ厚釜<BR>●最大炊飯容量区分／A<BR>●電源／AC100V 50/60Hz<BR>●電源ケーブル長さ／1m<BR>●消費電力／700W<BR>●寸法／約W23×D32×H19.5cm<BR>●ふた開き時の高さ／約36.5cm<BR>●質量／約4.2kg<BR>●付属品／しゃもじ、しゃもじ受け、計量カップ（白米用）、計量カップ（無洗米専用）<BR>●保証期間／1年（なべフッ素加工は3年）<BR>※商品箱へ配送伝票を直接貼り付けて発送をいたします。なお、商品箱は差し込み式のフタで、同梱のしゃもじはビニール袋には入っておりません。<br>●メーカー／象印<br>●型番／NP-RX05-TD<br>●JANコード／4974305211187<br><br>※メーカー都合によりパッケージ・仕様等が予告なく変更される場合がございます。ご了承ください。<br><br>本商品は自社サイトでも販売しているため、ご注文のタイミングにより、発送までにお時間をいただいたり、やむをえずキャンセルさせていただく場合がございます。<br><br>※沖縄へのお届けは別途1620円(税込)の送料がかかります。<p>お買い物マラソン等イベント開催中は、ご注文の集中により発送手続き、お問い合わせの回答にお時間をいただく場合がございます。ご了承ください。</p>

