●釜外側にはIH加熱と相性の良い鉄をコーティングし、発熱効率を高めた「鉄器コートプラチナ厚釜」採用の1升炊き圧力IH炊飯ジャー、ピンクシャンパン。釜内の炊きムラを抑えます。<BR>●釜内に溶け出した甘み成分（溶出還元糖）を含んだおねばがお米一粒一粒の表面をコーティング。内ぶたと内釜内面のプラチナコートの効果で、ごはんの甘み成分一つである還元糖量を高めています。<BR>●前回食べたごはんの味の感想を、アンケートに回答すると、炊き方を微調整し、炊くたびに好みの味に進化します。最大49通りの炊き方があり、ご家庭で使用される米の銘柄や、季節が変わっても好みの食感に炊き上がります。<BR>●底センサーが保温温度をコントロールし、水分の蒸発を抑えて30時間までおいしく保温します。<BR>●4つのセンサーが釜内の温度をきめ細かく調整しながらよりおいしくふっくら仕上げます。<BR>●炊きあがり後、ふたを開けてすぐにごはんをほぐさないと、うるおいセンサーが感知してブザーでお知らせします。おいしく食べるためのひと工夫です。<br>●加熱方式／圧力IH（誘導加熱）方式<BR>●炊飯容量／1升（0.18～1.8L）<BR>●色／ピンクシャンパン<BR>●内なべ／鉄器コートプラチナ厚釜<BR>●最大炊飯容量区分／D<BR>●電源／交流100V 50/60Hz<BR>●電源ケーブル長さ／1m（コードリール付）<BR>●消費電力／1370W<BR>●寸法／約W29.5×D42.5×H26cm<BR>●ふた開き時の高さ／約48cm<BR>●釜の厚さ／1.7mm<BR>●質量／約6.5kg<BR>●付属品／しゃもじ、しゃもじ受け、計量カップ（白米用（約180ml）、無洗米専用（約171ml））<BR>●保証期間／1年（なべフッ素加工は3年）<BR>※商品箱へ配送伝票を直接貼り付けて発送をいたします。なお、商品箱は差し込み式のフタで、同梱のしゃもじはビニール袋には入っておりません。<br>●メーカー／象印<br>●型番／NP-BF18-NZ<br>●JANコード／4974305212580<br><br>※メーカー都合によりパッケージ・仕様等が予告なく変更される場合がございます。ご了承ください。<br><br>本商品は自社サイトでも販売しているため、ご注文のタイミングにより、発送までにお時間をいただいたり、やむをえずキャンセルさせていただく場合がございます。<br><br>※沖縄へのお届けは別途1620円(税込)の送料がかかります。<p>お買い物マラソン等イベント開催中は、ご注文の集中により発送手続き、お問い合わせの回答にお時間をいただく場合がございます。ご了承ください。</p>

